INSERT INTO "EASY_Widget__c" VALUES(1,'Active','','<p><strong style="font-size: 18px; color: rgb(109, 54, 150);">Housing Deposit</strong></p><p style="text-align: center;"></p>','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Admit;Confirmed','','','','Housing Deposit Widget (UGTR)','<style>
INSERT INTO "EASY_Widget__c" VALUES(2,'Active','Status: Enrolled','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 20px;">We have received your deposit. Welcome to the University of St. Thomas! </strong></p><p><br></p><p><br></p><p><span style="font-size: 16px;">Watch your email for further information. In the meantime, contact </span><a href="mailto:international@stthomas.edu" target="_blank" style="font-size: 16px;">international@stthomas.edu</a><span style="font-size: 16px;"> with any questions.</span></p><p><br></p><p><span style="font-size: 16px;">F1 students, currently in the USA, should submit the </span><a href="https://www.stthomas.edu/_media-library/_documents/main/20190708-stthomas-international-admissions-SEVIS-form-v1-00.pdf" target="_blank" style="font-size: 16px;">SEVIS transfer form</a><span style="font-size: 16px;">. </span></p><p><br></p><p><br></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">Wanting to learn more about St. Thomas?</strong></p><p><span style="font-size: 16px;">Although we cannot host you on campus, we are offering a number of </span><a href="https://www.stthomas.edu/admissions/undergraduate/campus-visits/index.html" target="_blank" style="font-size: 16px;">virtual visits options</a><span style="font-size: 16px;"> to bring campus to you!</span></p><p style="text-align: center;"><br></p><p style="text-align: center;"><br></p><p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 20px;">Congratulations! We&#39;re so happy you&#39;ve chosen St. Thomas.</strong></p><p><span style="font-size: 16px;"> </span></p><p style="text-align: center;"><span style="font-size: 16px;"></span></p>','International','ApplicationPortal','Confirmed','','','','Graphic: UG Confirmed INTL (UGTR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','1');
INSERT INTO "EASY_Widget__c" VALUES(3,'Active','Status: Withdrawn','<p style="text-align: center;"></p>','International','ApplicationPortal','Withdrawn','','','','Graphic: UG Withdrawn INTL (UGTR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','1');
INSERT INTO "EASY_Widget__c" VALUES(4,'Inactive','','<p style="text-align: center;"><strong style="font-size: 14px; background-color: rgb(255, 255, 255); color: rgb(173, 28, 205);">Applying for Undergraduate Admissions? </strong><strong style="font-size: 14px; color: rgb(173, 28, 205);">The Fall 2022 application is available NOW!</strong></p><p><br></p><p><span style="font-size: 14px;">There are no application fees to apply and we offer the </span><span style="font-size: 14px; color: rgb(173, 28, 205);">St. Thomas</span><span style="font-size: 14px;"> application or the Common Application.</span></p><p><br></p><p><br></p><p style="text-align: center;"><span style="font-size: 14px; color: rgb(173, 28, 205);"> </span><span style="font-size: 14px; background-color: rgb(255, 255, 255); color: rgb(173, 28, 205);">Applying for Dougher<span class="ql-cursor"></span>ty Family College 2-year program?</span></p><p><br></p><p><span style="font-size: 14px;">The Dougherty Family College is a selective 2-year program offered at the University of St. Thomas. Acting as an eventual pathway to a 4-year degree, </span><a href="https://dfc.stthomas.edu/" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">https://dfc.stthomas.edu/</a>. <span style="font-size: 14px;">Dougherty Family College is designed to serve student populations with high financial need (as determined by FAFSA) and provides a supportive learning environment to recent high school graduates who have shown strong academic success and college-readiness but may benefit from additional supports and resources.</span></p><p><br></p><p><span style="font-size: 14px;">Applications are reviewed on a rolling basis—meaning we will review applications and admit students based on available space in our class. Don’t wait; apply today! </span></p><p><br></p><p style="text-align: center;"><br></p><p style="text-align: center;"><strong>Visit</strong></p><p style="text-align: center;"><a href="https://www.stthomas.edu/admissions/undergraduate/campus-visits" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/admissions/undergraduate/campus-visits</a></p><p><br></p><p style="text-align: center;"><strong style="font-size: 14px; background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">Meet your admissions counselor</strong></p><p style="text-align: center;"><a href="https://www.stthomas.edu/admissions/undergraduate/contact/locate-counselor" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/admissions/undergraduate/contact/locate-counselor</a></p><p><br></p><p style="text-align: center;"><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(68, 68, 68);">Why St. Thomas</strong></p><p><a href="https://www.stthomas.edu/admissions/undergraduate/post-graduation" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/admissions/undergraduate/post-graduation</a></p><p><br></p><p style="text-align: center;"><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(68, 68, 68);">Explore our majors and minors</strong></p><p><a href="https://www.stthomas.edu/academics/undergraduate" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/academics/undergraduate</a></p>','','ApplicationCreate','','','','','Graphic: UG Inquiry (UGTR)','','7.0','','','Top','Central Daylight Time (America/Chicago)','Custom','1');
