INSERT INTO "EASY_Widget__c" VALUES(8,'Active','Status: Enrolled','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">We have received your deposit. Welcome to the St. Thomas community!</strong></p><p><br></p><p><br></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">Continue to watch your personal email and St. Thomas email for more information. In the meantime, please don’t hesitate to contact your</span><span style="font-size: 16px; color: rgb(157, 36, 179);"> </span><a href="https://www.stthomas.edu/tr/locatecounselor/" target="_blank" style="font-size: 16px;">transfer counselor</a><span style="font-size: 16px;"> </span><span style="font-size: 16px; color: rgb(0, 0, 0);">with any questions you may have.</span></p><p><br></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">Use the links on the right to complete tasks for other St. Thomas offices.</span></p><p><br></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">Course Registration</strong></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">Fall registration will open for new transfer students on May 3, 2022. Information will be sent via email from the Academic Counseling office regarding that process.</span></p><p><br></p><p><br></p><p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">Congratulations! We’re so happy you&#39;ve chosen St. Thomas!</strong></p><p><br></p><p style="text-align: center;"></p>','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Confirmed','','','','Graphic: UG Confirmed (UGTR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','1');
