INSERT INTO "EASY_Widget__c" VALUES(67,'Active','Status: Enrolled','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(112, 48, 160);">We have received your deposit. Welcome to the St. Thomas community!</strong></p><p><br></p><p><br></p><p><span style="font-size: 16px;">Now that you’re officially going to be a Tommie, you should join the </span><a href="https://www.facebook.com/groups/692276151644990" target="_blank" style="font-size: 16px;">Class of 2026 Facebook page</a><span style="font-size: 16px;"> so you can connect with your future classmates and friends.</span></p><p><br></p><p><br></p><p><strong style="color: rgb(112, 48, 160); font-size: 16px;">Financial Aid</strong></p><p><span style="font-size: 16px;">If you completed the </span><a href="https://studentaid.ed.gov/sa/fafsa" target="_blank" style="font-size: 16px;">Free Application for Federal Student Aid</a><span style="font-size: 16px;"> (FAFSA) you will receive a comprehensive financial aid package starting January 15, if we have received your FAFSA.</span></p><p><br></p><p><strong style="color: rgb(112, 48, 160); font-size: 16px;">Placement Assessment</strong></p><p><span style="font-size: 16px;">You may need to complete placement assessments in some subjects. Placement assessments help make sure you register for the right classes when you begin at St. Thomas. The placement assessment process is now open. Visit the </span><a href="https://www.stthomas.edu/guide/placementassessments/" target="_blank" style="font-size: 16px;">assessment website</a><span style="font-size: 16px;"> for more information on how to complete this process. </span></p><p><br></p><p><span style="font-size: 16px;">Visit our </span><a href="https://www.stthomas.edu/admissions/undergraduate/freshman/admitted-students/" target="_blank" style="font-size: 16px;">Admitted Students website</a><span style="font-size: 16px;"> for important upcoming dates and feel free to contact your </span><a href="https://www.stthomas.edu/admissions/undergraduate/contact/locate-counselor" target="_blank" style="font-size: 16px;">admissions counselor</a><span style="font-size: 16px;"> with any questions. </span></p><p><br></p><p><br></p><p style="text-align: center;"><strong style="color: rgb(112, 48, 160); font-size: 20px;">Congratulations on making your college decision! We&#39;re so happy you&#39;ve chosen St. Thomas! </strong></p><p><span style="font-size: 16px;"> </span></p><p style="text-align: center;"></p>','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','ApplicationPortal','Confirmed','','','','Graphic: UG Confirmed FR (UGFR)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','13');
