INSERT INTO "Question__c" VALUES(145,'True','','','','Started App;Submitted App','','','','False','','','','','5.0','False','True','Started App','False','','','Apply Without Standardized Test','','','','False','','','','','Test Optional Consent Text (UGTR)','Name','False','','','01221000003n3I9AAI','','Started App','','','<p><br></p><p>I have chosen to apply as a test-optional applicant. By doing so, I understand that my standardized test scores (even if submitted) will not be considered as part of the admission or merit scholarship review process. I agree to the information the University of St. Thomas has shared about its test optional policy. I understand that if I change my mind and wish to have my test reviewed with my application, I should contact my admissions counselor to discuss my options. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','68');
