INSERT INTO "Question__c" VALUES(883,'True','','','','Started App;Submitted App','','','','False','','','','','2.0','False','True','Started App','False','','','','','','','False','','','','','Application Materials Consent Text (GSOE)','Name','False','','','01221000003n3I9AAI','','Started App','','','<p> </p><p>I understand that I have reviewed each page of my application. I certify that the information contained in this application, including all attachments and credentials, is complete and true to the best of my knowledge. I understand that misrepresentation of application information is sufficient grounds for denial of admissions or cancellation of admissions and registration. I understand that all materials received by the University of St. Thomas in connection with this application are not returnable and that the application fee (where applicable) is non-refundable. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','336');
