INSERT INTO "Question__c" VALUES(889,'True','','','','Started App;Submitted App','','','','False','','','','','15.0','False','True','Started App','False','','','','','','','False','','','','','EOE Statement (GSOE)','Name','False','','','01221000003n3I9AAI','','','','','<p><br></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is an equal opportunity educator and employer. St. Thomas does not unlawfully discriminate, in any of its programs or activities, on the basis of race, color, creed, religion, national origin, sex, sexual orientation, family status, disability, age, marital status, status with regard to public assistance, membership or activity in a local commission, genetic information or any other characteristic protected by applicable law. </strong><a href="http://www.stthomas.edu/eostatement" target="_blank"><strong>http://www.stthomas.edu/eostatement</strong></a></p><p><strong> </strong></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is registered with the Minnesota Office of Higher Education pursuant to sections 136A.61 to 136A.71. Registration is not an endorsement of the institution. Credits earned at the institution may not transfer to all other institutions. Contact information for the Minnesota Office of Higher Education is: 1450 Energy Park Drive, Suite 350 St. Paul, MN 55108-5227 Phone: (651) 642-0567 Toll Free: (800) 657-3866 Fax: (651) 642-0675 </strong><a href="https://www.ohe.state.mn.us/" target="_blank"><strong>https://www.ohe.state.mn.us/</strong></a></p>','','','','336');
